# JavaScript Console Snippets

JavaScript Console Snippet for Atom editor.



## Snippets
---

### [c.assert] console.assert(expression[, object, ...])
    console.assert( ${1:expression} ${2:, ${3:object} } );

### [c.clear] console.clear()
    console.clear();

### [c.count] count([title])
    console.count( ${1:title} );

### [c.debug] debug(object [, object, ...])':
    console.debug( ${1:object} ${2:, ${3:object} } );

### [c.dir] dir(object)':
    console.dir( ${1:object} );

### [c.dirxml] dirxml(node)':
    console.dirxml( ${1:node} );

### [c.error] error(object [, object, ...])':
    console.error( ${1:object} ${2:, ${3:object} } );

### [c.exception] exception(error-object[, object, ...])':
    console.exception( ${1:error-object} ${2:, ${3:object} } );

### [c.group] group(object [, object, ...])':
    console.group( ${1:object} ${2:, ${3:object} } );

### [c.groupCollapsed] groupCollapsed(object [, object, ...])':
    console.groupCollapsed( ${1:object} ${2:, ${3:object} } );

### [c.groupEnd] groupEnd()':
    console.groupEnd();

### [c.info] info(object [, object, ...])':
    console.info( ${1:object} ${2:, ${3:object} } );

### [c.log] log(object [, object, ...])':
    console.log( ${1:object} ${2:, ${3:object} } );

### [c.profile] profile([title])':
    console.profile( ${1:title} );

### [c.profileEnd] profileEnd()':
    console.profileEnd();

### [c.tab] tab(object [, object, ...])':
    console.tab( ${1:object} ${2:, ${3:object} } );

### [c.table] table(data[, columns])':
    console.table( ${1:data} ${2:, ${3:columns} } );

### [c.time] time(name)':
    console.time( ${1:name} );

### [c.timeEnd] timeEnd(name)':
    console.timeEnd( ${1:name} );

### [c.timeStamp] timeStamp(name)':
    console.timeStamp( ${1:name} );

### [c.trace] trace()':
    console.trace();

### [c.warn] warn(object [, object, ...])':
    console.warn( ${1:object} ${2:, ${3:object} } );

### [alert] 'alert([message])':
    window.alert( ${1:"message"} );




